import React, { useEffect, useState } from "react";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import "./App.css";

import { useSelector, useDispatch } from "react-redux";
import SignUp from "./components/SignUp";

function App() {
  const user = null;
  return (
    <Router>
      <div className="app">
        <Switch>
          <Route path="/" exact>
            <SignUp />
          </Route>
        </Switch>
      </div>
    </Router>
  );
}

export default App;
